function addReportExpander(){const e=document.querySelector("span#report-expander"),t=document.querySelector("div#report"),o=document.querySelector("div#report-brief i.material-icons");e.onclick=()=>{o.textContent=t.classList.toggle("hidden")?"unfold_more":"unfold_less",spyglass.contentUpdated()}}function addParamsExpander(){const e=document.querySelectorAll("ul.methods li.method");for(const t of Array.from(e)){const e=t.querySelector("i.material-icons");if(null==e){t.style.cursor="default";continue}const o=t.nextElementSibling;t.onclick=()=>{e.textContent=o.classList.toggle("hidden")?"arrow_drop_down":"arrow_drop_up",spyglass.contentUpdated()}}}function loaded(){addReportExpander(),addParamsExpander()}window.addEventListener("DOMContentLoaded",loaded);